import { StyledProjects } from "./styles/Projects.styled";

const Projects = () => {
  return (
    <StyledProjects>
      <div>
        <h1>Projects.</h1>
      </div>

      <div className="pokeContainer"></div>
      <div className="movieContainer"></div>
      <div className="amazonContainer"></div>
      <div className="gameContainer"></div>
    </StyledProjects>
  );
};

export default Projects;
